import React from "react";

function Task(props) {
  return (
    <div>
      <img src="./images/images (6).jfif" />
      <h2>Abdulmalik</h2>
      <p>Job Name</p>
      <p>Email</p>
      <p>Website</p>
    </div>
  );
}

export default Task;
